import React from 'react';
import { Document, Image, Page, StyleSheet, Text, View } from '@react-pdf/renderer';
import PropTypes from 'prop-types';
import formatDate from '../../utils/format-date';

const styles = StyleSheet.create({
    page: {
        flexDirection: 'column',
    },
    section: {
        marginLeft: 10,
        marginRight: 10,
        padding: 10,
        border: '1px solid #ccc',
    },
    titleText: {
        fontSize: 14,
        marginBottom: 8,
        fontWeight: 'bold',
    },
    inlineText: {
        fontSize: 12,
        marginBottom: 8,
        marginLeft: 8,
    },
    imageContainer: {
        width: '100%',
        flexDirection: 'row',
        justifyContent: 'flex-end',
    },
    logo: {
        width: 100,
        height: 'auto',
        marginRight: 10,
    },
});

// eslint-disable-next-line no-unused-vars
const DocumentPage = ({ serviceRequest }) => (
    <Document>
        <Page size='A4' style={ styles.page }>
            <View style={ styles.imageContainer }>
                <Image style={ styles.logo }
                       src='data:image/png;base64,' />
            </View>
            <View style={ [styles.section, { border: 'none !important' }] }>
                <Text>Solicitud de Servicio</Text>
            </View>
            <View style={ styles.section }>
                <Text style={ styles.titleText }>
                    Solicitud #{ serviceRequest.requestNumber } - { formatDate(new Date(serviceRequest?.createdAt)) }
                </Text>
                <Text style={ styles.inlineText }>Servicio: { serviceRequest.category.service.name }</Text>
                <Text style={ styles.inlineText }>Categoría: { serviceRequest.category.name }</Text>
            </View>
            <View style={ styles.section }>
                <Text style={ styles.titleText }>Cliente</Text>
                <Text style={ styles.inlineText }>Nombre: { serviceRequest.user.userDetails.firstName }</Text>
                <Text style={ styles.inlineText }>Apellido: { serviceRequest.user.userDetails.lastName }</Text>
                <Text style={ styles.inlineText }>Número de
                    Contacto: { serviceRequest.user.userDetails.phoneNumber }</Text>
                <Text style={ styles.inlineText }>Correo Electrónico: { serviceRequest.user.username }</Text>
            </View>
            <View style={ styles.section }>
                <Text style={ styles.titleText }>Respuestas del Formulario:</Text>
                { serviceRequest.formAnswers.map((formAnswer, index) => (
                    // eslint-disable-next-line react/no-array-index-key
                    <Text style={ styles.inlineText } key={ index }>
                        { formAnswer.question }: { formAnswer?.answer }
                    </Text>
                )) }
            </View>
        </Page>
    </Document>
);

DocumentPage.propTypes = {
    serviceRequest: PropTypes.shape({
        id: PropTypes.number,
        status: PropTypes.string,
        requestNumber: PropTypes.number,
        // eslint-disable-next-line react/forbid-prop-types
        formAnswers: PropTypes.array,
        user: PropTypes.shape({
            id: PropTypes.number,
            username: PropTypes.string,
            userDetails: PropTypes.shape({
                firstName: PropTypes.string,
                lastName: PropTypes.string,
                phoneNumber: PropTypes.string,
            }),
        }),
        category: PropTypes.shape({
            id: PropTypes.number,
            name: PropTypes.string,
            description: PropTypes.string,
            icon: PropTypes.string,
            service: PropTypes.shape({
                id: PropTypes.number,
                name: PropTypes.string,
                description: PropTypes.string,
            }),
        }),
        location: PropTypes.shape({
            lat: PropTypes.number,
            lng: PropTypes.number,
        }),
        createdAt: PropTypes.string,
        updatedAt: PropTypes.string,
    }).isRequired,
};

export default DocumentPage;
